                <div className='row justify-content-center'>
                    <div></div>
                    <h3> {`${this.state.first} ${this.state.last}`}</h3>
                </div>
                <div className='row'>
                </div>

                <div className='row'>
                </div>
            </div>

          </div>
        );
    }
}


export default ClientPage
